import logo from './logo.svg';
import './App.css';
import {Button} from '@material-ui/core';
import {BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";
import About from './components/About';
import Work from './components/Work'; 
import Home from './components/Home';
import mobileLanding from './img/mobileLanding.jpg';
import { Typography } from '@material-ui/core';
import Particles from 'react-particles-js';
import LandingBtn from './components/landingBtn';

//TODO: make buttons the same width, resize with same scale
//possible add particle effect
//drawer navigation links 

function App() {
  const imgUrl = window.innerWidth >=650 ? mobileLanding : mobileLanding;
  return (
    <Router>
        <Switch>
          <Route path="/work">
            <Work />
          </Route>
          <Route path="/home">
            <Home/>
          </Route>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/">

          <div className="App">
         
            <Particles className="App-header"/>
              <LandingBtn/>
             
            </div>
          
           
          </Route>
        </Switch>
    </Router>

    
    
  );

}

export default App;
